import React from "react";
import styled from "styled-components";
import me from "../img/me.JPG";
import { motion } from "framer-motion";
import {
  pageAnimation,
  Fade,
  photoAnim,
  LineAnim,
  slider,
  sliderContainer,
} from "../animation";
import { useScroll } from "../Components/useScroll";
import ScrollTop from "./../Components/ScrollTop";

const Bank = () => {
  const [element, controls] = useScroll();

  return (
    <Work
      style={{ background: "#fff" }}
      exit="exit"
      variants={pageAnimation}
      initial="hidden"
      animate="show"
    >
      <motion.div variants={sliderContainer}>
        <Frame1 variants={slider}></Frame1>
        <Frame2 variants={slider}></Frame2>
        <Frame3 variants={slider}></Frame3>
        <Frame4 variants={slider}></Frame4>
      </motion.div>

      <Movie>
        <motion.h2 className="head" variants={Fade}>
          Information Technology Security Engineer
        </motion.h2>
        <motion.h2 className="armour" variants={Fade}>
          <a href="https://depi.gov.eg/" target="_blank" rel="noopener noreferrer">
            National Bank of Egypt
          </a>
        </motion.h2>
        <motion.h6>
          April 2024 – Current
          <span>Cairo Plaza Towers - Kournish El Nile, Giza, Egypt</span>
        </motion.h6>
        <motion.div variants={LineAnim} className="line"></motion.div>
        <Responsibilities>
          <Responsibility>• 𝐏𝐫𝐢𝐯𝐢𝐥𝐞𝐠𝐞𝐝 𝐀𝐜𝐜𝐨𝐮𝐧𝐭 𝐌𝐚𝐧𝐚𝐠𝐞𝐦𝐞𝐧𝐭: Implement and maintain PAM solutions for various IT systems, including Active Directory, Oracle databases, SQL databases, and Unix systems.</Responsibility>
          <Responsibility>• 𝐏𝐨𝐥𝐢𝐜𝐲 𝐄𝐧𝐟𝐨𝐫𝐜𝐞𝐦𝐞𝐧𝐭: Develop and enforce policies for managing privileged accounts.</Responsibility>
          <Responsibility>• 𝐓𝐡𝐫𝐞𝐚𝐭 𝐃𝐞𝐭𝐞𝐜𝐭𝐢𝐨𝐧: Monitor and respond to suspicious activities involving privileged access.</Responsibility>
          <Responsibility>• 𝐂𝐨𝐦𝐩𝐥𝐢𝐚𝐧𝐜𝐞 𝐚𝐧𝐝 𝐀𝐮𝐝𝐢𝐭𝐬: Ensure PAM practices comply with industry standards and regulatory requirements, including regular audits and reviews.</Responsibility>
        </Responsibilities>
        <Hide>
          <motion.img variants={photoAnim} src={me} alt="Engineer Portrait" />
        </Hide>
      </Movie>

      <ScrollTop />
    </Work>
  );
};

const Work = styled(motion.div)`
  min-height: 100vh;
  overflow: hidden;
  padding: 2rem 5rem;
  @media (max-width: 768px) {
    padding: 2rem 2rem;
  }
`;

const Movie = styled(motion.div)`
  padding-bottom: 1rem;
  text-align: center;
  .head {
    font-size: 3rem;
    margin-bottom: 1rem;
    @media (max-width: 768px) {
      font-size: 2.5rem;
    }
  }
  .armour {
    font-size: 2rem;
    a {
      color: inherit;
      text-decoration: none;
      &:hover {
        text-shadow: 2px 2px 10px green;
      }
    }
  }
  h6 {
    font-size: 1.2rem;
    span {
      display: block;
      font-size: 1rem;
    }
  }
  .line {
    height: 0.2rem;
    background: #23d997;
    margin: 1.5rem 0;
  }
  img {
    width: 100%;
    height: 50vh;
    object-fit: cover;
    box-shadow: 0px 0px 10px rgba(0, 0, 0, 0.8);
  }
`;

const Responsibilities = styled.div`
  display: flex;
  flex-direction: column;
  align-items: center;
  font-size: 1.1rem;
  color: black;
  padding: 1rem 2rem;
  max-width: 800px;
  margin: auto;
  line-height: 1.6;
`;

const Responsibility = styled.p`
  text-align: left;
  width: 100%;
  margin: 0.5rem 0;
`;

const Hide = styled.div`
  overflow: hidden;
`;

// Frame Animations
const Frame1 = styled(motion.div)`
  position: fixed;
  left: 0%;
  top: 10%;
  width: 100%;
  height: 100vh;
  background: #fffebf;
  z-index: 2;
`;
// Other frames with different colors
const Frame2 = styled(Frame1)`background: #ff8efb;`;
const Frame3 = styled(Frame1)`background: #8ed2ff;`;
const Frame4 = styled(Frame1)`background: #8effa0;`;

export default Bank;
